define({"topics" : [{"title":"API Introduction","shortdesc":"\n            <p class=\"shortdesc\"><span class=\"ph\">Yeastar Cloud PBX</span> provides API interfaces for you to integrate a third-party     software or device.\n            </p>\n         ","id":"topic_l4v_hrc_gdb","href":"topic\/api_introduction.html","menu": {"hasChildren":false,},"tocID":"topic_l4v_hrc_gdb-d46e23465","topics":[]},{"title":"Change Logs of API Version","shortdesc":"\n            <p class=\"shortdesc\">When sending an API request, the request address must include the API version. All         request samples in this guide use\n               {api version} to represent the API version.\n            </p>\n         ","id":"concept_dxf_gr2_h2b","href":"topic\/change_logs_of_api_version_cloud.html","menu": {"hasChildren":false,},"tocID":"concept_dxf_gr2_h2b-d46e23538","topics":[]},{"title":"API Demo","shortdesc":"\n            <p class=\"shortdesc\">Yeastar provides an API demo and sample configurations for you to test the API         functions with <span class=\"ph\">Yeastar Cloud PBX</span>.\n            </p>\n         ","id":"concept_htc_pt2_h2b","href":"topic\/api_demo.html","menu": {"hasChildren":false,},"tocID":"concept_htc_pt2_h2b-d46e23609","topics":[]},{"title":"Enable API Access on PBX","shortdesc":"\n            <p class=\"shortdesc\">Before you start, enable API access on the PBX first.</p>\n         ","id":"task_zm3_wdd_gdb","href":"topic\/enable_api_access_on_pbx.html","menu": {"hasChildren":false,},"tocID":"task_zm3_wdd_gdb-d46e23683","topics":[]},{"title":"Delete Blocked API IP","shortdesc":"\n            <p class=\"shortdesc\">If an IP exceeds the allowed failed API login attempts, PBX will block the IP and tag         the blocked IP as <span class=\"ph uicontrol\">API-IP</span>. You can delete the blocked API IP if the IP         is trusted.\n            </p>\n         ","id":"task_wfl_k12_nfb","href":"topic\/api_delete_blocked_api_ip.html","menu": {"hasChildren":false,},"tocID":"task_wfl_k12_nfb-d46e23754","topics":[]},{"title":"API Interfaces","shortdesc":"\n            <p class=\"shortdesc\">References of API interfaces and API samples.</p>\n         ","id":"topic_qt2_332_gdb","href":"topic\/api_interfaces.html","menu": {"hasChildren":true,},"tocID":"topic_qt2_332_gdb-d46e23828","next":"topic_qt2_332_gdb-d46e23828",},{"title":"System Report","shortdesc":"\n            <p class=\"shortdesc\">The PBX will send report to the application server automatically when there is a change     of system configuration or extension\n               status, etc.\n            </p>\n         ","id":"topic_dsn_qq2_gdb","href":"topic\/api_system_report.html","menu": {"hasChildren":true,},"tocID":"topic_dsn_qq2_gdb-d46e27844","next":"topic_dsn_qq2_gdb-d46e27844",},{"title":"Call Report","shortdesc":"\n            <p class=\"shortdesc\">The PBX will send call report to the application server automatically. Call event like     call transfer, call failure, call\n               released, etc. will be reported.\n            </p>\n         ","id":"topic_wwt_sq2_gdb","href":"topic\/api_call_report.html","menu": {"hasChildren":true,},"tocID":"topic_wwt_sq2_gdb-d46e28122","next":"topic_wwt_sq2_gdb-d46e28122",},{"title":"Error Code","shortdesc":"\n            <p class=\"shortdesc\">References of API error codes.</p>\n         ","id":"reference_rbf_yq2_gdb","href":"topic\/api_error_code.html","menu": {"hasChildren":false,},"tocID":"reference_rbf_yq2_gdb-d46e29114","topics":[]}]});